import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import logo from '../images/logo.png';
import '../css/KM.css'
import Card from "react-bootstrap/Card";

const KM = React.memo(() => {
    return(
        <Container className="wide">
            <Row>
                <Col sm>
                    <Card style={{ width: '18rem' }}>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title>Oliver Jensen</Card.Title>
                            <Card.Subtitle className="mb-2 text-muted">Klubbm√§stare</Card.Subtitle>
                        </Card.Body>
                    </Card>
                </Col>
                <Col sm>
                    <img src={logo} className="portrait" alt="portrait"/>
                    <h1>Johan Widmark</h1>
                </Col>
                <Col sm>
                    <img src={logo} className="portrait" alt="portrait"/>
                    <h1>Adam Henriksson</h1>
                </Col>
            </Row>
            <Row>
                <Col sm><img src={logo} className="portrait" alt="portrait"/></Col>
                <Col sm><img src={logo} className="portrait" alt="portrait"/></Col>
                <Col sm><img src={logo} className="portrait" alt="portrait"/></Col>
            </Row>
        </Container>
    )
});


export default KM;
